void OAIVisionExamplesApi::updateDatasetAsync2(const QString &dataset_id, const ::OpenAPI::OptionalParam<QString> &data, const ::OpenAPI::OptionalParam<QString> &path) {
    QString fullPath = QString(_serverConfigs["updateDatasetAsync2"][_serverIndices.value("updateDatasetAsync2")].URL()+"/v2/vision/datasets/{datasetId}/upload");
    
    if (!_bearerToken.isEmpty())
        addHeaders("Authorization", "Bearer " + _bearerToken);
    
    
    {
        QString dataset_idPathParam("{");
        dataset_idPathParam.append("datasetId").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "datasetId", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"datasetId"+pathSuffix : pathPrefix;
        fullPath.replace(dataset_idPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(dataset_id)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "PUT");

    if (data.hasValue())
    {
        input.add_var("data", ::OpenAPI::toStringValue(data.value()));
    }
    if (path.hasValue())
    {
        input.add_var("path", ::OpenAPI::toStringValue(path.value()));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIVisionExamplesApi::updateDatasetAsync2Callback);
    connect(this, &OAIVisionExamplesApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

